    false,nt"url": null,nt"notes": "Conductivity Temperature and Depth (CTD)
    measurements were collected aboard the NOAA Ship Thomas Jefferson to determine physical
    oceanographic parameters of the water column, and in some cases used to help guide
    sample collection as part of the Deepwater Horizon oil spill sampling effort. Temperature,
    conductivity/salinity, depth, dissolved oxygen, and fluorometry data were collected
    onboard the NOAA Ship Thomas Jefferson, Cruise 03. The final product is a series
    of NetCDF files containing every CTD cast that has been processed and quality checked.",nt"license_title":
